import './date.css';

function date() {
  return (
    <div className="date">
 <div className="card-date">
        <p className="material-text-date"><span>base de donnee</span><span className="time-sub-text-date">11:00PM</span></p>
        <p className="day-text-date">Wednesday, June 15th</p>
      </div>
    </div>
  );
}

export default date;
